  const location = useLocation();
  // console.log(location);
  const movie = location.movie
  return (
    <div className="watch">
      <div className="back">
        <ArrowBackOutlined />
        Home
      </div>
      {/* <iframe
        src="https://www.youtube.com/embed/_Re5RzYZexc"
        title="YouTube video player"
        frameBorder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowFullScreen
      ></iframe> */}
      <video
        src={movie.video}
        progress
        loop
        controls
        autoPlay
      ></video>
    </div>
  );
}
